CREATE TABLE etradmin(
    azonosito VARCHAR2(32) not null,
    vezeteknev VARCHAR2(64) not null,
    keresztnev VARCHAR2(64) not null,
    telefonszam VARCHAR2(64) not null,
    email VARCHAR2(64) not null,
    jelszo VARCHAR2(64) not null,
    CONSTRAINT azonositoAdmin_pk PRIMARY KEY (azonosito)
);


CREATE TABLE kepzes(
    kepzesid VARCHAR(64) not null,
    nev VARCHAR(64) not null,
    CONSTRAINT kepzesis_pk PRIMARY KEY (kepzesid)
);


CREATE TABLE hallgato(
    azonosito VARCHAR2(6) not null,
    vezeteknev VARCHAR2(64) not null,
    keresztnev VARCHAR2(64) not null,
    szemelyiszam VARCHAR2(64) not null,
    telefonszam VARCHAR2(64) not null,
    email VARCHAR2(64) not null,
    jelszo VARCHAR2(64) not null,
    szulido DATE not null,
    CONSTRAINT azonosito_pk PRIMARY KEY (azonosito)
);


create table felvette(
    id NUMBER GENERATED ALWAYS as IDENTITY(START with 1 INCREMENT by 1),
    hallgatoAzonosito VARCHAR2(6) not null,
    kepzesId VARCHAR(64) not null,
    teljesitette NUMBER(1) default 0 not null,
    CONSTRAINT hallgatoAzonositoFelvette_fk FOREIGN KEY (hallgatoAzonosito) REFERENCES hallgato(azonosito) ON DELETE CASCADE,
    CONSTRAINT kepzesIdFelvette_fk FOREIGN KEY (kepzesId) REFERENCES kepzes(kepzesid) ON DELETE CASCADE
    );
    
work commit;
